import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import { ChakraProvider, extendTheme } from '@chakra-ui/react';
import Login from './pages/login/login'; // Certifique-se de que o caminho est치 correto e o nome do arquivo est치 correto

// Extend Chakra UI theme if needed
const theme = extendTheme({
  // Custom theme properties
});

function App() {
  return (
    <ChakraProvider theme={theme}>
      <Router>
        <Routes>
          <Route path="/" element={<Login />} /> {/* Use 'element' para renderizar componentes */}
          <Route path="/dashboard" element={<Login />} /> 
        </Routes>
      </Router>
    </ChakraProvider>
  );
}

export default App;
